descricao:
O OBJETO DO PRESENTE CONTRATO É A EXECUÇÃO, PELA CONTRATADA, SOB O REGIME DE EMPREITADA POR PREÇO UNITÁRIO DA CONSTRUÇÃO DO LABORATÓRIO DE BOTÂNICA APLICADA  ETAPA UFRN, DE ACORDO COM OS PROJETOS BÁSICO E EXECUTIVO, ESPECIFICAÇÕES TÉCNICAS, PLANILHA DE QUANTITATIVOS E DEMAIS ANEXOS DA CONCORRÊNCIA Nº 06/2013-DMP.
UNIDADE 01 - CONSTRUÇÃO DO PRÉDIO DA CASA DE VEGETAÇÃO  ETAPA CT-INFRA IX;
UNIDADE 02 - CONSTRUÇÃO DO LABORATÓRIO DE BOTÂNICA APLICADA  ETAPA CT- INFRA VIII;
UNIDADE 03 - CONSTRUÇÃO DO LABORATÓRIO DE BOTÂNICA APLICADA  ETAPA UFRN;

O OBJETO DO PRESENTE  CONTRATO É A EXECUÇÃO, PELA CONTRATADA, SOB O REGIME DE EMPREITADA POR PREÇO UNITÁRIO, DE ACORDO COM OS PROJETOS BÁSICO E EXECUTIVO, ABAIXO:
DA CONCORRÊNCIA Nº 07/2013-UFRN
ITEM- 01 - CONSTRUÇÃO DO LABORATÓRIO DE NUTRIÇÃO ANIMAL;
ITEM-02 - CONSTRUÇÃO DO GALPÃO DE APOIO AO LABORATÓRIO DE NUTRIÇÃO ANIMAL;
ITEM- 03 - ADEQUAÇÃO DE GALPÃO E DO LABORATÓRIO DE NUTRIÇÃO ANIMAL;
ITEM-04 - COMPLEMENTAÇÃO DA CONSTRUÇÃO DO LABORATÓRIO DE NUTRIÇÃO ANIMAL;
ITEM-05 - SISTEMAS DE GASES ESPECIAIS PARA O LABORATÓRIO DE NUTRIÇÃO ANIMAL.

SERVIÇOS E REFORMAS, EM VÁRIOS SETORES DA UFRN:IMPLANTAÇÃO DA ACESSIBILIDADE DA ESCOLA DE MÚSICA; CONFECÇÃO DE BANCADAS PARA O LABORATÓRIO DE GEOGRAFIA FÍSICA DO CCHLA;  
REFORMA DO LABORATÓRIO DE REATORES E TERMODINÂMICA  UNIDADE 1 DE ENG. QUÍMICA;
REFORMA DO LABORATÓRIO DE BIOMEDICINA DO CB; E REFORMA DOS BANHEIROS (BWC) DO DEPARTAMENTO DE BIOFÍSICA E FARMACOLOGIA DO CB.

CONSTITUI O OBJETO DA PRESENTE LICITAÇÃO A EXECUÇÃO, SOB O REGIME DE EMPREITADA POR PREÇO UNITÁRIO, A OBRA/SERVIÇO EM DIVERSOS SETORES DO CAMPUS UNIVERSITÁRIO CENTRAL, COM FORNECIMENTO DE MATERIAL, FERRAMENTAL, EQUIPAMENTOS E MÃO-DE-OBRA, OBSERVADOS OS PROJETOS BÁSICO E EXECUTIVO, PLANILHAS DE QUANTITATIVOS E DEMAIS ANEXOS DESTE EDITAL, CONFORME RELACIONADOS NOS ITENS ABAIXO:

01  AMPLIAÇÃO DO LABORATÓRIO DE TRATAMENTOS TÉRMICOS DO DEPARTAMENTO DE MATERIAIS;

02  REFORMA NO PRÉDIO DE QUÍMICA DO PETRÓLEO PARA INSTALAÇÃO DE CAIXAS SEPARADORAS DE ÁGUA E ÓLEO;

03  ADAPTAÇÃO DA CALÇADA EXTERNA DO PAVILHÃO DE ADMINISTRAÇÃO DO CENTRO DE CIÊNCIAS HUMANAS LETRAS E ARTES.
